import { Canvas } from '@react-three/fiber';

const NavTextPreviewScene = () => {
  return (
    <>
      <Canvas>
        <mesh>
          <meshBasicMaterial />
        </mesh>
      </Canvas>
    </>
  );
};

export default NavTextPreviewScene;
